// Styles files 
import '../styles/index.scss'

// -----------------------------------------------------
export default () => (
  <div>
  <TopRight className="topRight"/>
  <Head title="Acceuil | Company name"/>
  <Header/>
  <Body_section1/>
  </div>
);
